select count(*) as num_positive_comments
from analyzed_comments
where naivesbayes_probability_positive >= 0.5;

select count(*) as num_negative_comments
from analyzed_comments
where naivesbayes_probability_positive < 0.5;

select round(avg(price_in_thousands),2) as avg_price_top_selling_car 
from us_car_sales_2011 
where sales_in_thousands > 100;
